import random
import string
from datetime import datetime
import pystray
from pystray import MenuItem as item
import pyperclip
from PIL import Image
import base64
from io import BytesIO

# Закодированная строка данных файла иконки
icon_data = """"""

def get_token():
    current_datetime = datetime.now()
    random_numbers = current_datetime.strftime('%Y%m%d%H%M%S')
    numbers_sum = sum(map(int, random_numbers))
    random_multiplier = random.randint(1, 9)
    result = numbers_sum * random_multiplier
    random_letters = ''.join(random.choices(string.ascii_uppercase + string.ascii_lowercase, k=25))
    token = f"{result}-WT{random_letters}"
    return token

def copy_token(icon, item):
    token = get_token()
    pyperclip.copy(token)

def exit_action(icon, item):
    icon.stop()

def create_tray_icon():
    # Декодируем строку данных обратно в иконку
    icon_image = Image.open(BytesIO(base64.b64decode(icon_data)))

    menu = (item('Копировать', copy_token),
            item('Выход', exit_action))
    icon = pystray.Icon("Генератор веб-токенов", icon_image, "Генератор веб-токенов", menu=menu)
    return icon

if __name__ == "__main__":
    icon = create_tray_icon()
    icon.run()